(4, 'DANIELROMPAS ', '81340074067', '4', 'SULAWESI', 'BITUNG', 'Site 1', 'SEKOLAH (SMK NEGERI 1 BITUNG)', 'BITUNG', 'Gangguan Lainnya; ', '"Pada Senin, 13 Januari 2014, saat dinyalakan semuanya berjalan normal,\r\nkecuali alat modem VSAT-nya yang sampai sekian lama LED indikator ""net""\r\nberkedap-kedip (Warna orange) bergantian dengan LED TX.\r\n(foto terlampir)\r\nsetelah kira-kira 15 menit baru LED ""net"" menjadi normal menyala tetap dan berwarna hijau.\r\nHari ini Rabu, 15 Januari 2014 kejadian serupa terjadi lagi, ketidaknormalan\r\ntersebut lebih lama lagi berlangsungnya (30 menit)\r\nSelama belum normal tidak bisa mengakses Internet walaupun Wi-Fi dalam keadaan terkoneksi."\r\n', '', ''),
(5, 'JOTAM TANGULU', '81242863655', '4', 'SULAWESI', 'BITUNG (KOTA', 'Site 2', 'KOMINFO', 'BITUNG', 'Gangguan Jaringan; ', 'Tidak ada koneksi\r\n', '', ''),
(6, 'John Tine', '81340232064', '4', 'SULAWESI', 'KEPULAUAN TALAUD', 'Site 2', 'SEKOLAH - SMA N 1 MELONGUANE', 'MELONGUANE', 'Gangguan Perangkat; ', '"aplikasi server tidak jalan sehingga tidak menggunakan server....\r\nsementara ini dibypass dari sisi modem dan menggunakan router lokasi\r\njaringan internet sering mengalami gangguan"\r\n', '', ''),
(7, 'IVAN PANGGEY', '85240003402', '4', 'SULAWESI', 'KEPULAUAN TALAUD', 'Site 2', 'SEKOLAH - SMA N 1 MELONGUANE', 'MELONGUANE', 'Gangguan Perangkat; ', '"aplikasi server tidak jalan sehingga tidak menggunakan server....\r\nsementara ini dibypass dari sisi modem dan menggunakan router lokasi\r\njaringan internet sering mengalami gangguan"\r\n', '', ''),
(8, 'DENY WAJONG', '8884587976', '4', 'SULAWESI', 'TOMOHON', 'Site 2', 'KANTOR LURAH', 'PERUM ULUINDANO', 'Gangguan Lainnya; ', 'IP DHCP CLIENT TIDAK DAPAT\r\n', '', ''),
(9, 'DANIELROMPAS', '81340074067', '4', 'SULAWESI', 'BITUNG', 'Site 1', 'SEKOLAH (SMK NEGERI 1 BITUNG)', 'BITUNG', 'Gangguan Jaringan; ', '"Pada Senin, 13 Januari 2014, saat dinyalakan semuanya berjalan normal,\r\nkecuali alat modem VSAT-nya yang sampai sekian lama LED indikator ""net""\r\nberkedap-kedip (Warna orange) bergantian dengan LED TX.\r\n(foto terlampir)\r\nsetelah kira-kira 15 menit baru LED ""net"" menjadi normal menyala tetap dan berwarna hijau.\r\nHari ini Rabu, 15 Januari 2014 kejadian serupa terjadi lagi, ketidaknormalan\r\ntersebut lebih lama lagi berlangsungnya (30 menit)\r\nSelama belum normal tidak bisa mengakses Internet walaupun Wi-Fi dalam keadaan terkoneksi."\r\n', '', ''),
(10, 'JOTAM TANGULU', '81242863655', '4', 'SULAWESI', 'BITUNG (KOTA', 'Site 2', 'KOMINFO', 'BITUNG', 'Gangguan Jaringan; ', 'Tidak ada koneksi\r\n', '', ''),
(11, 'John Tine', '81340232064', '4', 'SULAWESI', 'KEPULAUAN TALAUD', 'Site 2', 'SEKOLAH - SMA N 1 MELONGUANE', 'MELONGUANE', 'Gangguan Perangkat; ', '"aplikasi server tidak jalan sehingga tidak menggunakan server....\r\nsementara ini dibypass dari sisi modem dan menggunakan router lokasi\r\njaringan internet sering mengalami gangguan"\r\n', '', ''),
(12, 'IVAN PANGGEY', '85240003402', '4', 'SULAWESI', 'SITARO', 'Site 1', 'DISHUBKOMINFO', 'SIAU', 'Gangguan Aplikasi; ', 'aplikasi server tidak jalan sehingga client tidak mendapatkan IP DHCP\r\n', '', ''),
(13, 'Bpk. Aslam', '82393965252', '4', 'SULAWESI', 'Tolitoli', 'Site 2', 'Sekolah (Pengelola)', 'MAA Kalangkangan', 'Gangguan Jaringan; ', 'info dari pengelola (Pak Aslam), infokan signal wifi dapat namun tidak bisa konek ke internet.. cek sisi vsat la, test ping ke modem OK\r\n', '', ''),
(14, 'Agus Husna', '85341392288', '4', 'GORONTALO', 'Bone Bolango', 'Site 1', 'Sekolah', 'Jalan Sawah Besar Desa Talango kec. Kabila', 'Gangguan Lainnya; ', '"Untuk MA Kabila ( Bone Bolango SITE A ) Sesuai informasi dari PIC tdk diaktifkan, dengan alasan mereka tdk bisa konek ke jaringan wifinya\r\nsaya kepikiran kalau bukan perangkatnya yang bermasalah tetapi staff dan guru yang ada disitu tidak tau caranya untuk menghubungkan laptop mereka\r\ndengan perangkat wifi/uso. padahal kemarin sudah ada masyarakat sekitar yang sudah memanfaatkan fasilitas ini, dan sesuai hasil uji coba yang sudah\r\nsaya lakukan pada saat aktivasi perangkat yang ada di SITE ini berfungsi dengan baik.\r\n"\r\n', '', ''),
(15, 'Agus Husna', '85341392288', '4', 'GORONTALO', 'Gorontalo Utara', 'Site 1', 'SMA 1 Anggrek', 'Jl. Siswa Desa Popalo - Anggrek', 'Gangguan Aplikasi; ', '"SMKN 1 Anggrek (Gorontalo Utara SITE A) sesuai informasi dari PIC untuk perangkat wifinya tdk di aktifkan karena mereka belum bisa login ke halaman\r\nwifi/uso, tetapi internet yang ada tetap bisa di manfaatkan dengan cara menghubungkan modem secara langsung ke salah satu laptop.\r\n"\r\n', '', ''),
(16, 'Agus Husna', '85341392288', '4', 'GORONTALO', 'SMA Negeri 2 Kwandang', 'Site 2', 'SMA 2 Kwndang', 'Jl. Kusno Danupoyo - Kwandang', 'Gangguan Perangkat; ', 'ISOTRA tidak berfungsi ( mati total )\r\n', '', ''),
(17, 'Agus Husna', '85341392288', '4', 'GORONTALO', 'Bone Bolango', 'Site 2', 'SMK Negeri 1 Bulango', 'Jl. Tapa Boidu', 'Gangguan Perangkat; ', 'STAVOLT tidak berfungsi (Mati Total)\r\n', '', ''),
(18, 'Agus Husna', '85341392288', '4', 'GORONTALO', 'Gorontalo', 'Site 2', 'Kantor Desa Mongolato', 'Jl. Muhamad A. Wahab', 'Gangguan Perangkat; ', 'Salah Satu Radio Wifi Mati ( tidak berfungsi )\r\n', '', ''),
(19, 'sandi', '85737008234', '6', 'BALI', 'karangasem,buleleng,bangli,neg', 'Site 1', 'kordinator', 'denpasar barat', 'Gangguan Jaringan; ', '"Wifi mati total. Banyak server yang mati. Proses mantenen tidak ada. Tolong di respon dan dicari solusinya....\r\n\r\n"\r\n', '', ''),
(20, 'sandi', '85737008234', '6', 'BALI', 'karangasem,buleleng,bangli,neg', 'Site 2', 'kordinator', 'denpasar barat', 'Gangguan Jaringan; ', '"Wifi mati total. Banyak server yang mati. Proses mantenen tidak ada. Tolong di respon dan dicari solusinya....\r\n\r\n"\r\n', '', ''),
(21, 'Hut Prokla Wolley', '8991675333', '4', 'SULAWESI', 'minahasa tenggara', 'Site 2', 'sekolah', 'jalan lowu II kec. ratahan', 'Gangguan Jaringan; ', '"jaringan sering RTO\r\nkecepatan akses tidak sesuai dengan kontrak \r\njadi kalau pemakai sudah melebihi 4 pengguna, maka sangat sulit untuk terhubung ke internet.\r\n\r\nmohon penyelesaiannya."\r\n', '', ''),
(22, 'Hut Prokla Wolley', '8991675333', '4', 'SULAWESI', 'MINAHASA TENGGARA', 'Site 2', 'SEKOLAH', 'JALAN LOWU II KEC. RATAHAN', 'Gangguan Jaringan; ', '"Gangguan:\r\nKoneksi internet terputus-putus terlalu lama RTO lama\r\nkecepatan banwith yang terpasang tidak sesuai dengan kontrak... saat ini banwith kira-kira 250 kbps\r\n\r\nMohon penyelesaiannya.. karena internet disini sangat dibutuhkan untuk UKK ujian kompetensi kejuruan SMK teknik komputer dan jaringan.\r\n\r\nTerima kasih...."\r\n', '', ''),
(23, 'DINDIN GINANJAR', '81805234874', '6', 'NUSA', 'MATARAM', 'Site 2', 'SMKN 4 MATARAM', 'JL. PENDIDIKAN 45 MATARAM', 'Gangguan Perangkat; ', 'Terjadi renovasi halaman parkir yang mengakibatkan perangkat VSAT digeser, namun tanpa penyambungan. Sudah dilakukan kontak dengan LIntas Arta mataram, Hingga kini masih off.\r\n', '', ''),
(26, 'Tes123', '08567875284', 'Kalimantan (Paket 3)', 'KALIMANTAN', 'Bengkawang', '', '', '', '', '', 'Minggu, 30 Maret 2014', ''),
(27, 'Sholahuddin Alisyahbana', '08799999777', 'Balinusra (Paket 6)', 'NUSA TENGGARA BARAT', 'Bengkawang', 'Site 2', 'UIN Jakarta', 'JL. RAYA SUNGAI RAYA KEC. SUNGAI', 'Gangguan Jaringan; ', 'Ada gangguan Di Pusat', 'Minggu, 30 Maret 2014', ''),
